import React, { Component } from 'react'
import axios from 'axios';

export default class Class4 extends Component {
  constructor(){
    super();
    this.state ={
        apidata:[]
    }
  }

    componentDidMount(){
        axios.get('http://localhost:9000/users2')
        .then(res=>{
            console.log(res.data);
            this.setState({
                apidata:res.data
            });
        })
    }
    render() {
    return (
      <div></div>
    )
  }
}
